import { Carousel } from "./../../../../components";
export const SelectProgram = () => {
  return (
    <div>
      step 1 - select program
      <Carousel>
        <div style={{ color: "white" }}>hello world 1</div>
        <div style={{ color: "white" }}>hello world 2</div>
        <div style={{ color: "white" }}>hello world 3</div>
        <div style={{ color: "white" }}>hello world 4</div>
        <div style={{ color: "white" }}>hello world 5</div>
        <div style={{ color: "white" }}>hello world 6</div>
        <div style={{ color: "white" }}>hello world 7</div>
        <div style={{ color: "white" }}>hello world 8</div>
      </Carousel>
    </div>
  );
};
